    "legacy-data-for-a-northern-prairie-grassland-woodworth-study-area-north-dakota-1963-89",nt"isopen":
    false,nt"url": null,nt"notes": "Ecological data commonly become more valuable
    through time. Such legacy data providebaseline records of past biological, physical,
    and social information that provide historicalperspective and are necessary for
    assessment of stasis or change. Legacy data collected at theWoodworth Study Area
    (WSA), a contiguous block of grasslands, croplands, and wetlandscovering more than
    1,000 hectares of the Prairie Pothole Region of North Dakota, are catalogedand summarized
    in this study. The WSA is one of the longest researched grassland sites in theUpper
    Midwest. It has an extensive history of settlement, land use, and management thatprovides
    a deeper context for future research. The WSA data include long-term vegetationtransect
    records, land use history, habitat management records, geologic information, wetlandhydrology
    and chemistry information, and spatial images. Substantial parts of these data have
    notbeen previously reported. The WSA is representative of many other lands purchased
    by the U.S.Fish and Wildlife Service in the Prairie Pothole Region from the 1930s
    to the 1970s; therefore,synthesized data from the WSA are broadly applicable to
    topics of concern in northerngrasslands, such as increases in non-native plants,
    managing for biodiversity, and long-termeffects of habitat management. New techniques
    are also described that were used to preservethese data for future analyses. The
    data preservation techniques are applicable to any project withdata that should
    be preserved for 100 years or more.",nt"license_title": "License Not Specified",nt"extras":
